import React from "react";

const ContactUs = () => {
  return (
    <div className="mt-28 flex">
      <div className="flex flex-col">
        <img src="images/export.png" alt="export" />
        <p className="mt-4 text-[#000000]">
          {" "}
          @ 2023 Find My Trials. <br />
          All right reserved.
        </p>
      </div>
      <div className="flex flex-col">
        <h1 className="text-[#050F4E] text-2xl">Get In Touch</h1>
      </div>
    </div>
  );
};

export default ContactUs;
